import Link from 'next/link';
const linkStyle = {
    marginRight: 15
  };
export default function About() {


    return (
      <div>
           <Link href="/" style={linkStyle}>
            <a>About Page</a>
        </Link> || 
        <Link href="/index" style={linkStyle}>
            <a>About Page</a>
            </Link>
        <p>This is the about page</p>
      </div>
    );
  }
